export default function Experience() {
  return (
    <div id="experience">
      <h4>EXPERIENCE</h4>
      <h6>professional</h6>
      <ul>
        <li>Professional marketing experience working with web development teams to coordinate site and product launches and improve user experience.</li>
      </ul>
      <h6>education</h6>
    </div>
  )
}
